@Component({selector:'app-about',templateUrl:'./about.component.html',styleUrls:['./about.component.css']})
export class AboutComponent {}
<div class="card">
  <h2>About Me</h2>
  <p class="lead">I'm a frontend engineer focused on creating pixel-perfect interfaces and performant user experiences using Angular and modern web tools.</p>
  <h3>Education</h3>
  <p class="lead">B.Tech — IPS College of Management</p>
</div>
